import SearchBar from "../SearchBar";
import { Link } from "react-router-dom";

const Nav = ({onSearch, addRandomCharacter}) => {
    const handleAddRandomCharacter = () => {
        addRandomCharacter();
    };
    return (
        <div>
            <SearchBar onSearch={onSearch} />
            <button onClick={handleAddRandomCharacter}>Agregar Personaje Random</button>
            <Link to= "/">
                <button>HOME</button>
            </Link>
            <Link to= "/About">
                <button>ABOUT</button>
            </Link>
        </div>
    );
}

export default Nav;
